import React,{Component} from "react";
import "./App.css"

class App extends Component {
  constructor(){
    super();

  }  
  render(){
    var arr = [];
    for(let i=0 ; i<=30 ; i++){
      arr[i]=`<div className="div_child">i`;
    }

    return (
      <div className="App">
        {arr}
      </div>
    );
  }
}

export default App;
